var title_f43_7_44155="Comparative approach to hyst";
var content_f43_7_44155=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=OBGYN%2F53367&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=OBGYN%2F53367&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Comparison of three approaches to hysterectomy for benign gynecological disease",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Vaginal hysterectomy compared to abdominal hysterectomy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Shorter hospitalization (mean difference 1 day, 95% CI 0.7 -1.2)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Speedier return to normal activities (mean difference 9.5 days, 95% CI 6.4-12.6)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Fewer infections or fevers (OR 0.42, 95% CI 0.21-0.83)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Laparoscopic hysterectomy compared to abdominal hysterectomy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Less blood loss (mean difference 45.3 mls, 95% CI 17.9-72.7)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Shorter hospital stay (mean difference 2 days, 95% CI 1.9-2.2)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Speedier return to normal activities (mean difference 13.6 days, 95% CI 11.8-15.4)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Fewer wound infections or fevers (OR 0.32, 95% CI 0.12-0.85)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Longer operating time (mean difference 10.6 minutes, 95% CI 7.4-13.8)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        More urinary tract injuries (OR 2.61, 95% CI 1.22-5.60)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Laparoscopic hysterectomy compared to vaginal hysterectomy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Similar outcomes except longer operating time (mean difference 41.5 min, 95% CI 33.7-49.4)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Total laparoscopic hysterectomy compared to laparoscopically assisted vaginal hysterectomy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Similar outcomes except longer operating time (mean difference 25.3 min, 95% CI 10-40.6)",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from Johnson, N, Barlow, D, Leghaby, A, et al. Cochrane Datase Syst Rev 2006; 2:CD003677.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
